import './promo.css'

const Promo = () => {
    return (<section className="Promo">
        <div className="container">
            <div className="promo__content">
                <div className="promo__text">TEXT</div>
                <div className="promo__img">IMG</div>
            </div>
        </div>
    </section> );
}
 
export default Promo ;
